pp.userapi.com/c621700/v621700475/552ef/NGmF9A3wYPM.jpg"},{"id":"550345","owner":"-15538981","text":"","attaches":[{"id":"photo-15538981_456250457","type":"photo","w":1080,"h":1080,"thumbs":{"75":"https://pp.userapi.com/c834303/v834303268/af932/XEnb4eBos8Y.jpg","130":"https://pp.userapi.com/c834303/v834303268/af933/O0l6mR9r2mw.jpg","604":"https://pp.userapi.com/c834303/v834303268/af934/hkgW0mn3rVw.jpg","807":"https://pp.userapi.com/c834303/v834303268/af935/QPjpKDTMPLc.jpg","1280":"https://pp.userapi.com/c834303/v834303268/af936/_Q07ZIU1TBc.jpg"}}],"source_id":"-15538981","source_type":"VK","remote_id":"-15538981_140328","time":"1518977400","likes":"41","reposts":"2","comments":"0","images_cnt":"1","gifs_cnt":"0","data_id":"550345","owner_name":"Кот","owner_url":"/vk.koshki","owner_avatar":"https://pp.userapi.com/c409829/v409829172/59bf/yH-bx292s74.jpg"},{"id":"550349","owner":"56766245568546","text":"Вы не кашлянете ни разу за всю зиму! Измельчите банан и добавьте вот эти два простых компонента\nВместо того, чтобы выбрасывать деньги на таблетки медицинской мафии, которые имеют побочные эффекты попробуйте это натуральное и эффективное средство. Вы избавитесь от кашля окончательно и даже обогатите Ваше тело витаминами.\nСмотрите ниже, как просто приготовить это натуральное средство!\nИнгредиенты:\nДва спелых банана\nДва столовые ложки меда\n400 мл воды\nПриготовление:\n• Налейте воду в кастрюлю и поставьте ее на огонь, дайте ей закипеть.\n• Очистите бананы от кожуры и хорошенько раздавите их с помощью вилки.\n• После того, как вода достигнет точки кипения, выключите огонь и медленно добавьте бананы в воду.\n• Тщательно все перемешайте, пока вы не получите однородную пасту.\n• Когда смесь немного остынет, добавьте мед и лекарство готово.\nКак принимать:\nПринимайте несколько чайных ложек этой смеси четыре раза в день. Но немного подогрейте перед употреблением.\nВсего через несколько дней, вы заметите, что кашель проходит и вы почувствуете себя намного лучше. Также эта смесь нормализует ваш сон, потому что бананы обладают успокоительными свойствами.\nПо крышам бегал, голубей гонял..\nПродолжение ниже... ЖМИ\n#животные   #кошки   #милота   #котята","attaches":[{"id":"photo_1fab1a5c3ba661af130b4e9cb4cd40ae","type":"photo","w":"548","h":"365","thumbs":{"548":"https://i.mycdn.me/image?id=860950690606&t=0&plc=WEB&tkn=*iWoaSwHMjsBMIJ2HdD88rWgXG78"}},{"id":"photo_494c84c9c662bfc28bf11c86855b37ba","type":"photo","w":"548","h":"548","thumbs":{"548":"https://i.mycdn.me/image?id=863640735062&t=3&plc=WEB&tkn=*aisWK_R_kIyCBNjjlR4O2s6Mamg"}},{"id":"photo_905e91047acb9d43206eac038ca93790","type":"photo","w":"612","h":"443","thumbs":{"612":"https://i.mycdn.me/image?id=863640735318&t=0&plc=WEB&tkn=*rg5xILH6c702jNOTJkuP4vlgwJA"}},{"id":"photo_69ef9dbea21e57f1c243c3765f29166b","type":"photo","w":"548","h":"338","thumbs":{"548":"https://i.mycdn.me/image?id=863640735830&t=0&plc=WEB&tkn=*uSXluSDCfxYxKRAp4Ad4Du4nIk4"}},{"id":"photo_4bdfd3fe55ce3654f59e1a8ec9b17607","type":"photo","w":"612","h":"427","thumbs":{"612":"https://i.mycdn.me/image?id=863640736086&t=0&plc=WEB&tkn=*suW4YW4lbFT7D7SHGOZjETqfqEI"}},{"id":"photo_afed5bfa8499817941340777686ca7a7","type":"photo","w":"612","h":"387","thumbs":{"612":"https://i.mycdn.me/image?id=863640736342&t=0&plc=WEB&tkn=*pCpiV8Uapq08roQL6s9cgt0lkIM"}}],"source_id":"56766245568546","source_type":"OK","remote_id":"67758352837410","time":"1518977400","likes":"66","reposts":"19","comments":"0","images_cnt":"6","gifs_cnt":"0","data_id":"550349","owner_name":"Коты. Котики. Котята.","owner_url":"https://ok.ru/group/56766245568546","owner_avatar":"https://i.mycdn.me/i?r=ADErzYVfayHh9JRE7l1rDgHGKVW6XB5ARcEDRfndkHAeySu-5vxsgJl5wvC8iMj50vo"},{"id":"550347","owner":"-33621085","text":"Когда вы с котаном - одна команда","attaches":[{"id":"photo-33621085_456283341","type":"photo","w":650,"h":677,"thumbs":{"75":"https://pp.userapi.com/c841223/v841223139/6b789/PBExcC-3h4Q.jpg","130":"https://pp.userapi.com/c841223/v841223139/6b78a/H